import "./Fill.css";
import React from "react";

const Fill = () => {
  return (
    <div className="Fill">
      <div className="Filling-lang-background">
        <div className="fill-top-text">
          Please place bottle under the blinking button & press it to start
          refilling
        </div>
      </div>
    </div>
  );
};

export default Fill;
